import React, { Component } from 'react';
import "./Footer.css"

class Footer extends Component {
    render() {
        return (
            <div className="Footer">
                <h5>"OrigamiClub" 2019</h5>
                <div className="Footer-content">
                    <p>Складываем оригами с 2012 года</p>
                    <p>Сложи и ты</p>
                </div>
            </div>
        );
    }
}

export default Footer;
